var iMaxPageNum=0;function getquerystring(d){var f=new RegExp("(^|&)"+d+"=([^&]*)(&|$)");var e=window.location.search.substr(1).match(f);if(e!=null){return unescape(e[2])}return null}function setmaxpagenum(){iMaxPageNum=document.getElementById("maxPage").innerText}function prepage(){var b=getquerystring("page");if(b==null){b=1}else{b--}setcurpage(b)}function nextpage(){var b=getquerystring("page");if(b==null){b=1}else{b++}setcurpage(b)}function setcurpage(d){if(d<1){d=1}else{if(d>iMaxPageNum){d=iMaxPageNum}}var c="?page="+d;window.location.href=c}function initpage(){setmaxpagenum();convert2md()}function convert2md(){var c=document.getElementsByName("markdownContent");for(var d=0;d<c.length;d++){compile(c[d])}}function compile(e){var f=new showdown.Converter();var d=f.makeHtml(e.textContent);e.innerHTML=d};